    <style>
        body {
            margin: 0;
            background-color: black;
            color: white;
        }
        .poster-icon {
          overflow: visible;
          display: inline-block;
          transform: translateZ(0);
        }
        
        .poster-icon path {
          fill: #007bff !important;
          animation: pulse-fill 1.5s infinite;
          transform-origin: center;
        }
        @keyframes pulse-fill {
          0% {
            fill: #007bff;
            transform: scale(1);
          }
          50% {
            fill: #66b2ff;
            transform: scale(1.3);
          }
          100% {
            fill: #007bff;
            transform: scale(1);
          }
        }
        .media-control[data-media-control] .media-control-layer[data-controls] .bar-container[data-seekbar] .bar-background[data-seekbar] {
            height: 3px !important;
        }
        .media-control[data-media-control] .media-control-layer[data-controls] .bar-container[data-seekbar]:hover .bar-background[data-seekbar] {
            height: 5px !important;
        }
        #histats-container {
            display: none;
        }

        .warp-botao {
            font-size: 12px;
            font-weight: bold;
            padding: 6px 10px;
            background-color: blue;
            color: white;
            border: none;
            border-radius: 10px;
            position: fixed;
            top: 10px;
            right: 10px;
            z-index: 1;
            display: inline-block;
        }
        
        .warp-botao:hover {
            cursor: pointer;
            background-color: #000000;
            color: #FFFFFF;
            border: 1px solid #FFFFFF;
        }
        @media screen and (max-width: 400px) {
            .warp-botao {
                top: 10px;
                right: 10px;
                font-size: 3vw;
                padding: 3px 5px;
            }
        }
    </style>
